import React from "react";
import apiCalls from "../utilities/apiCalls";

export default function NavBar({ search }) {
  function getData() {
    apiCalls.getUsers();
    console.log();
  }
  return (
    <nav>
      <div>
        <>
          <input
            className="form-control"
            type="search"
            onChange={e => search(e)}
          />
          <button onclick="getData();">Search</button>
        </>
      </div>
    </nav>
  );
}
